content:
有时，我们希望在博客中插入动画或引入视频。选择没有广告的Bilibili网站作为引用源是非常合适的选择。
在不用插件的情况下用官方的iframe方式引入视频，默认的方式导入视频屏幕会很小，调整控制参数则会导致不同设备浏览不能适配。
<div>
	<iframe src="//player.bilibili.com/player.html?aid=424390748&bvid=BV1i3411j7WR&cid=518600683&page=1" scrolling="no" border="0" frameborder="no" framespacing="0" allowfullscreen="true"> </iframe>
</div>

为了适配，我们在`hexo\themes\aircloud\source\css`中添加代码
```css
/*哔哩哔哩视频适配*/

.bilibili{

    position: relative;

    width: 100%;

    height: 0;              /*高度设置这里无效，设置为0，用padding撑开div*/

    padding-bottom: 75%;    /*68%到80%都可以*/

}

.bilibili iframe {

    position: absolute;

    width: 100%;

    height: 100%;

    left: 0;

    top: 0;

}
```
然后我们就可以得到适配后的视频
<div class="bilibili">
	<iframe src="//player.bilibili.com/player.html?aid=424390748&bvid=BV1i3411j7WR&cid=518600683&page=1" scrolling="no" border="0" frameborder="no" framespacing="0" allowfullscreen="true"> </iframe>
</div>
插入视频的具体用法为：
``` markdown
<div class="bilibili">
	<iframe src="//player.bilibili.com/player.html?aid=424390748&bvid=BV1i3411j7WR&cid=518600683&page=1" scrolling="no" border="0" frameborder="no" framespacing="0" allowfullscreen="true"> </iframe>
</div>
```
